import React from "react";
import { AiOutlineSearch } from "react-icons/ai";

const SearchBar = () => {
  return (
    <div className="search_tab">
      <div>
        <i>
          <AiOutlineSearch />
        </i>
        <input placeholder="Search Github Username..." type="text" />
      </div>
      <button>Search</button>
    </div>
  );
};

export default SearchBar;
